law.text:
The amount of fees prescribed in connection with a license as a speech-language pathologist, speech-language pathology assistant, or audiologist shall be as follows:
The initial license fee for licensure as a speech-language pathologist or an audiologist shall not exceed two hundred dollars ($200);
The delinquency fee for all credentials shall not exceed forty dollars ($40);
The application fee for all credentials shall not exceed fifty dollars ($50);
The initial and renewal fees for an inactive license shall not exceed twenty dollars ($20);
The speech-language pathology assistant license fee shall not exceed one hundred fifty dollars ($150); and
The interim license fee shall not exceed one hundred fifty dollars ($150).
